import React from "react"
import Country from "./Country"

const Countries = (props) => {
    return(
        <ul>
            {props.countries.map(country =>
                {if(props.countries.length > 10)
                    return <p>Too many matches</p>
                else return(
                <Country 
                    key={country.numeriCode}
                    country={country}
                />
            )})}
        </ul>
    )
}

export default Countries
